import React from 'react';

const WeatherInfo = props => {
    const {
        city,
        date,
        coordlon,
        coordlat,
        temp,
        temp_min,
        temp_max,
        pressure,
        humidity,
        windspeed,
        err,
    } = props.weather

    let content = null;

    if(!err && city) {

        content = (
            <>
                <h4>Wyniki wyszukiwania dla: {city}</h4>
                <h4>{date}</h4>
                <h4>{coor}</h4>
                <h4>{temp}</h4>
                <h4>{temp_min}</h4>
                <h4>{temp_max}</h4>
                <h4>{pressure}</h4>
                <h4>{humidity}</h4>
                <h4>{windspeed}</h4>
            </>
        )
    }
    return (
        <div className="weatherInfo">
            {err ? `Nie ma w bazie wyszukiwanego miasta: ${city}` : content}
        </div>
    )
}

export default WeatherInfo;
